import React from "react";

export default function Register() {
  return (
    <a href="/home" class="mx-10">
      <svg
        xmlns="http://www.w3.org/2000/svg"
        fill="none"
        viewBox="0 0 24 24"
        stroke-width="2"
        stroke="#B7B6B8"
        class="w-10 h-10 border-[3px] border-[#B7B6B8] rounded-full mx-10 mt-5">
        <path
          stroke-linecap="round"
          stroke-linejoin="round"
          d="M15.75 19.5L8.25 12l7.5-7.5"
        />
      </svg>
    </a>
  );
}
